import React from 'react';

export const Signup = () => {
  return (
    <>
      <div className="overlay">
        <div className="modal-box">
            <span className="closebtn">&times;</span>
            <div className="form-container">
                <form action="">
                    <div className="inputbox"><h1>hew</h1></div>
                </form>
            </div>
        </div>
      </div>
    </>
  );
}
